import styled from 'styled-components';

export const Container = styled.div`
  width: 100%;
  height: 100vh;

  .firstArticle {
    width: 100%;
    height: 100vh;
    background: #FEEDD9;
  }

  .firstImage {
    width: 100%;
    height: 100vh;
    background: #FEEDD9;
  }

  > p {
    text-align: center;
  }
`;
